import React from 'react';
import { connect } from 'react-redux';

import { fetch_default, close_video } from '../actions';

class NavMenu extends React.Component {

    clickDefault = e => {
        e.preventDefault();
        this.props.fetch_default();
    };

    backToSearch = e => {
        e.preventDefault();
        this.props.close_video();
    };

    render() {
        return (
            <div className="container">
                <nav className="navbar navbar-dark bg-dark">
                    <a href="/" onClick={this.clickDefault} className="nav-link">Home</a>
                    <a href="/" onClick={this.backToSearch} className="nav-link">Back to Search</a>
                    <a target="_blank" rel="noreferrer noopener" href="https://danieldiaz.github.io" className="nav-link">Portfolio</a>
                </nav>
            </div>
        );
    }
}

export default connect(null, {fetch_default, close_video})(NavMenu);
